import {React,useEffect,useState} from 'react';
import Axios from 'axios'

function Home() {

   useEffect(()=>
   {
    fetch('https://jsonplaceholder.typicode.com/todos/1')
    .then(response => response.json())
    .then(res => console.log(res.data))

   },[]);


  return (
    <div>
    <h1> I am home</h1>
    </div>
  );
}

export default Home;
